import React from 'react';
import { useNavigate } from 'react-router-dom';
import { CheckCircle, Package, Truck, ArrowRight, ShoppingBag } from 'lucide-react';

const SuccessPage = () => {
  const navigate = useNavigate();
  
  // Generate a random order number
  const orderNumber = Math.floor(Math.random() * 900000) + 100000;

  return (
    <div style={container}>
      <div style={card}>
        {/* Success Icon */}
        <div style={iconCircle}>
          <CheckCircle size={50} color="#fff" />
        </div>

        <h1 style={title}>Order Placed Successfully!</h1>
        <p style={subtitle}>
          Thank you for shopping with MegaMart Rwanda. <br />
          Your order <span style={orderHighlight}>#{orderNumber}</span> is being processed.
        </p>

        <hr style={divider} />

        {/* Timeline/Next Steps */}
        <div style={stepsContainer}>
          <div style={step}>
            <div style={activeStepIcon}><Package size={18} /></div>
            {/* FIX: stepText is now defined below */}
            <div style={stepText}>
              <p style={stepTitle}>Order Confirmed</p>
              <p style={stepDesc}>We have received your order details.</p>
            </div>
          </div>
          
          <div style={step}>
            <div style={stepIcon}><Truck size={18} /></div>
            <div style={stepText}>
              <p style={stepTitle}>Dispatching</p>
              <p style={stepDesc}>Delivery to your address within 24 hours.</p>
            </div>
          </div>
        </div>

        {/* Action Buttons */}
        <div style={buttonGroup}>
          <button onClick={() => navigate('/profile')} style={primaryBtn}>
            View My Orders <ChevronIcon />
          </button>
          <button onClick={() => navigate('/')} style={secondaryBtn}>
            <ShoppingBag size={18} /> Continue Shopping
          </button>
        </div>
      </div>
      
      <p style={footerNote}>Need help with your delivery? Contact us at support@megamart.rw</p>
    </div>
  );
};

// --- Small UI Helper ---
const ChevronIcon = () => <ArrowRight size={18} style={{ marginLeft: '8px' }} />;

// --- STYLES ---
const container = {
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
  minHeight: '90vh',
  backgroundColor: '#f4f7f6',
  padding: '20px',
  fontFamily: 'sans-serif'
};

const card = {
  backgroundColor: 'white',
  padding: '40px',
  borderRadius: '20px',
  boxShadow: '0 10px 30px rgba(0,0,0,0.05)',
  maxWidth: '500px',
  width: '100%',
  textAlign: 'center'
};

const iconCircle = {
  width: '80px',
  height: '80px',
  backgroundColor: '#28a745',
  borderRadius: '50%',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  margin: '0 auto 20px auto',
  boxShadow: '0 4px 15px rgba(40, 167, 69, 0.3)'
};

const title = { fontSize: '24px', color: '#1a1a1a', margin: '0 0 10px 0' };
const subtitle = { fontSize: '15px', color: '#666', lineHeight: '1.5', margin: '0 0 20px 0' };
const orderHighlight = { color: '#008ECC', fontWeight: 'bold' };
const divider = { border: 'none', borderTop: '1px solid #eee', margin: '20px 0' };

const stepsContainer = { textAlign: 'left', marginBottom: '30px', paddingLeft: '20px' };
const step = { display: 'flex', gap: '15px', marginBottom: '20px' };

// THE FIX: Defined stepText style
const stepText = { display: 'flex', flexDirection: 'column', justifyContent: 'center' };

const stepIcon = { 
  width: '36px', height: '36px', borderRadius: '50%', 
  backgroundColor: '#f0f0f0', display: 'flex', 
  alignItems: 'center', justifyContent: 'center', color: '#888' 
};
const activeStepIcon = { ...stepIcon, backgroundColor: '#e8f5e9', color: '#28a745' };
const stepTitle = { margin: 0, fontWeight: 'bold', fontSize: '14px', color: '#333' };
const stepDesc = { margin: 0, fontSize: '12px', color: '#777' };

const buttonGroup = { display: 'flex', flexDirection: 'column', gap: '10px' };
const primaryBtn = {
  padding: '14px', backgroundColor: '#008ECC', color: 'white', 
  border: 'none', borderRadius: '12px', fontWeight: 'bold', 
  cursor: 'pointer', display: 'flex', alignItems: 'center', justifyContent: 'center',
  transition: 'transform 0.2s'
};
const secondaryBtn = {
  padding: '14px', backgroundColor: 'transparent', color: '#008ECC', 
  border: '1px solid #008ECC', borderRadius: '12px', fontWeight: 'bold', 
  cursor: 'pointer', display: 'flex', alignItems: 'center', justifyContent: 'center', gap: '8px'
};

const footerNote = { marginTop: '20px', fontSize: '13px', color: '#999' };

export default SuccessPage;
